import styled from 'styled-components'
import Card from 'react-bootstrap/Card';

const Task = () => {
    return (
        <Container>
             <Card className="card">
                <Card.Text>
                {"HELLLLO"}
                </Card.Text>
            </Card>
        </Container>
    )
}

export default Task

const Container = styled.div`
    width: 100%;
    height: 60px;       
    background-color: #C0C0C0;
`
